export const companies = () =>
  fetch("json/companies.json").then((res) => res.json());
const tickets = () => fetch("json/tickets.json").then((res) => res.json());
export const segments = () =>
  fetch("json/segments.json").then((res) => res.json());

let ticketsArr = [];

tickets().then((data) => {
  data.forEach((element) => {
    ticketsArr.push(element.price);
  });
});

export default ticketsArr;
